import React from 'react';
import {BrowserRouter, Route} from "react-router-dom";

import Header from './components/Header';
import Footer from './components/Footer';
import RecomendedCard from './components/RecomendedCards';
function App() {
  return (
    <React.Fragment>
      <Header />
      <div className="container-fluid pt-5">
        <div className="row">
          <div className="col-8">
          <BrowserRouter>
            <Route exact path="/" component={()=> <h1>hello</h1>}/>
            <Route exact path="/g" component={()=> <h1>good</h1>}/>
          </BrowserRouter>
          </div>
          <RecomendedCard />
        </div>
      </div>
      <Footer />
    </React.Fragment>
  );
}

export default App;
